import React from 'react';
import { FiFacebook, FiTwitter, FiInstagram, FiLinkedin, FiGithub } from 'react-icons/fi';
import '../styles/Footer.css';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const footerLinks = [
    {
      title: "Product",
      links: ["Features", "Pricing", "Case Studies", "Reviews", "Updates"]
    },
    {
      title: "Company",
      links: ["About", "Careers", "News", "Press", "Contact"]
    },
    {
      title: "Support",
      links: ["Help Center", "Community", "API", "Status", "Documentation"]
    },
    {
      title: "Legal",
      links: ["Privacy", "Terms", "Security", "Cookies", "Licenses"]
    }
  ];

  const socialLinks = [
    { icon: <FiFacebook />, url: "#" },
    { icon: <FiTwitter />, url: "#" },
    { icon: <FiInstagram />, url: "#" },
    { icon: <FiLinkedin />, url: "#" },
    { icon: <FiGithub />, url: "#" }
  ];

  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-top">
          <div className="footer-brand">
            <a href="#home" className="logo">
              Aurora<span>.</span>
            </a>
            <p className="footer-description">
              Building beautiful digital experiences that transform businesses and delight users.
            </p>
            <div className="social-links">
              {socialLinks.map((social, index) => (
                <a 
                  key={index} 
                  href={social.url} 
                  className="social-link"
                  aria-label={`Follow us on ${social.icon}`}
                >
                  {social.icon}
                </a>
              ))}
            </div>
          </div>

          <div className="footer-links">
            {footerLinks.map((column, index) => (
              <div key={index} className="link-column">
                <h4>{column.title}</h4>
                <ul>
                  {column.links.map((link, idx) => (
                    <li key={idx}>
                      <a href="#">{link}</a>
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        </div>

        <div className="footer-bottom">
          <p>&copy; {currentYear} Aurora. All rights reserved.</p>
          <div className="footer-bottom-links">
            <a href="#">Privacy Policy</a>
            <span>•</span>
            <a href="#">Terms of Service</a>
            <span>•</span>
            <a href="#">Cookie Policy</a>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
